def prime_factorize(num):
    prime = 2
    while num != 1:
        if num % prime == 0:
            yield prime
            num //= prime
        else:
            prime += 1

def any_non_digit(factors):
    return any(f > 9 for f in factors)

digits = [ 2, 3, 4, 5, 6, 7, 8, 9]
rev_digits = list(reversed(digits))

def list_to_int(list):
    s = 0
    for d in list:
        s *= 10
        s += d
    return s

def gcd(a, b):
    if b == 0:
        return a
    if a > b:
        return gcd(b, a % b)
    elif a == b:
        return a
    else:
        return gcd(b, a)

def has_common_factor(a, b):
    return gcd(a, b) > 1

def min_digits_dividing(num):
    # print('min num', math.log(num))
    while num != 1:
        for d in rev_digits:
            while num % d == 0:
                yield d
                num /= d

def next_zero_free(target_string):
    for i in range(len(target_string)):
        if target_string[i] == '0':
            return target_string[:i] + '1' * (len(target_string) - i)
    return target_string

def can_make_up_answer(amount, digits):
    if amount == 1:
        return True
    min_dividing_l = list(reversed(list(min_digits_dividing(amount))))
    return len(min_dividing_l) <= digits

def make_up_answer(amount, digits):
    if amount == 1:
        return '1' * digits
    min_dividing_l = list(reversed(list(min_digits_dividing(amount))))
    # print('dig', digits, len(min_dividing_l))
    # print(list_to_int(min_dividing_l))
    return ('1' * (digits - len(min_dividing_l))) + (str(list_to_int(min_dividing_l)) if min_dividing_l else '')

def same_num_digits_iterative(amount, target_string):
    # print(len(target_string), 'digits')
    target_string = next_zero_free(target_string)

    amount_accum = amount
    for digit in target_string:
        g = gcd(amount_accum, int(digit))
        amount_accum //= g
        if amount_accum == 1:
            return target_string
    
    prefix_product_gcds = [1 for _ in range(len(target_string))]
    for i in range(1, len(target_string)):
        prefix_product_gcds[i] = gcd(prefix_product_gcds[i - 1] * int(target_string[i - 1]), amount)
    # print(prefix_products)

    for start_change_index in range(len(target_string) - 1, -1, -1):
        if target_string[start_change_index] == '9':
            continue
        # print('start change at', start_change_index)
        pg = prefix_product_gcds[start_change_index]
        
        amount_left = amount // pg

        start = max(int(target_string[start_change_index]), 1)
        end = 10
        digits_after_change = len(target_string) - start_change_index - 1
        # print('start change', start_change_index, repr(target_string[start_change_index]), 'digits after', digits_after_change)
        for digit in range(start + 1, end):
            amount_left_after_digit = amount_left // gcd(digit, amount_left)
            if can_make_up_answer(amount_left_after_digit, digits_after_change):
                last_part = make_up_answer(amount_left_after_digit, digits_after_change)
                # print('last part', last_part)
                return target_string[:start_change_index] + str(digit) + last_part
    
    return -1

def more_num_digits_answer(amount, target_string):
    num_target_digits = len(target_string)
    min_dividing_l = list(reversed(list(min_digits_dividing(amount))))
    min_dividing = ''.join(str(d) for d in min_dividing_l)
    digit_difference = len(target_string) - len(min_dividing)
    return '1' * (digit_difference + 1) + min_dividing


def answer(amount, target_string):
    min_dividing_l = list(min_digits_dividing(amount))
    # print('min div len', len(min_dividing_l))
    if len(min_dividing_l) > len(target_string):
        more = more_num_digits_answer(amount, target_string)
        return more
    # print('start')
    same = same_num_digits_iterative(amount, target_string)
    if same != -1:
        return same
    # print('done same', same)
    more = more_num_digits_answer(amount, target_string)
    print('done more', more)
    return more

class Solution(object):
    def smallestNumber(self, num, t):
        factors = list(prime_factorize(t))
        if any_non_digit(factors):
            return '-1'
        else:
            return str(answer(t, num))
            
            

